public boolean equals(Object obj) {
  if (obj == null) {
    return false;
  }
  if (obj == this) {
    return true;
  }
  if (obj.getClass() != getClass()) {
    return false;
  }
  BalanceJob bj = (BalanceJob) obj;
  return new EqualsBuilder()
      .append(id, bj.id)
      .append(procedureTable, bj.procedureTable)
      .append(firstProcedure, bj.firstProcedure)
      .isEquals();
}
